import { Typography } from "@mui/material";
import { Box } from "@mui/system";
import React from "react";

const AboutUsBox = {
    display: 'flex',
    flexDirection: 'column',
    alignItems : 'center',
    mt: '200px'
}

function Profile() {
  return (
    <>
      <Box sx={AboutUsBox}>
        <Typography>
          About us 
        </Typography>
        <Typography sx={{width: '400px', textAlign: 'center', fontWeight: 'bold', fontSize: '25px'}}>
         We're on a mission to make education in the world more Fun
        </Typography>
        <Typography sx={{width: '400px', textAlign: 'center', fontSize: '15px'}}>
          Our mission is to empower any students to learn better, faster. We eradicate boredom in education, making students happier.
        </Typography>
      </Box>
      <Box sx={{display: 'flex', justifyContent: 'center', mt: '100px'}}>
          <Typography>the world's best unive teams use MUI to build their UIs.</Typography>
      <img src="https://cdn.langit7.id/foto/750/langit7/berita/2022/02/23/1/11933/mengenal-ivy-league-8-universitas-terbaik-di-amerika-psn.jpeg" width='350px'/>
      </Box>
    </>
  );
}

export default Profile;
